import { createSlice } from '@reduxjs/toolkit';

const patientSlice = createSlice({
    name: 'patient',
    initialState: {
        doctors: [],
        locker: [], // Your chart vitals/records will be stored here
    },
    reducers: {
        setDoctors: (state, action) => {
            state.doctors = action.payload;
        },
        setLocker: (state, action) => {
            state.locker = action.payload;
        },
    },
});

// These are the actions your 'Actions/patient.js' file is looking for
export const { setDoctors, setLocker } = patientSlice.actions;

export default patientSlice.reducer;
